properties.description:
Lo stabile di recente costruzione, è stato ultimato nel 2010.
Situato in via Beato Michele Da Carcano, facilmente raggiungibile con M1 e mezzi pubblici.
L'immobile è eretto per 6 piani, con doppio ascensore, attualmente locato ad una fondazione, che ha contratto in scadenza al 2030.
Composto da:
Piano Interrato: 12 box auto;
Piano Terra: Giardino privato e locale commerciale di 115mq;
Piano Primo: 3 uffici, 2 abitazioni;
Piano Secondo: 5 abitazioni;
Piano Terzo: 4 abitazioni;
Piano Quarto: 4 abitazioni;
Piano Quinto: 4 abitazioni;
Piano Sesto: 1 abitazione, sala fitness ad uso dello stabile e terrazzo su entrambe le esposizioni.Il contratto di locazione in essere è calcolato su base annuale in € 210'000,00.
